import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <header>
      <div className='container'>
        <div className='row space-between'>
          <div className='logo'>
            <Link to='/'>s.honchariuk</Link>
          </div>
          <div className='logo'>
            <Link to='/'>More Photos</Link>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
